import logo from './logo.svg';

import image from './images/antiantimage.png';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className = 'TitleBar'>
          <img src= {image} alt="No Antimage" style={{height: "5vw"}}/> 
          <div className = 'TitleText'>
            <div>
            The Anti-AntiMage App: AntiMage = Anti-Fun
            </div>
          </div>
        </div>
        <text className = 'About'>
          About:{"\n"}
        </text>
        <text className = 'About'>
          Antimage is the least fun hero to play against in Dota 2. 
          This app helps you build an antimage-resistant draft.
        </text>
      </header>
    </div>
  );
}

export default App;
